import React from "react";
import GenderCardStyle from "./GenderCardStyled";

const GenderCard = (props) =>
{
  const { gender } = props;
  console.log(gender);

  if(gender.length > 1){
      return(
      <GenderCardStyle>
        <div className="row">
          <h1>
            {gender}
          </h1>
        </div>
      </GenderCardStyle>
    )

  }else{
      return(
      <GenderCardStyle>
        <div className="row">
          <h1>
            NADA
          </h1>
        </div>
      </GenderCardStyle>
    )
    }
  };

export default GenderCard;
